import React from "react";
import ReactDom from "react-dom";
import logo from "./air_bnb_logo.webp"


const Navbar = () =>
{
  return (
    <>
      <div className="upper">
        <img src = {logo}/>
      </div>
    </>
  )
}



const Element = <>
  <Navbar/>



</>




const root = ReactDom.createRoot(document.getElementById('root'));
root.render(Element);
